import React from 'react';

class FooterLink extends React.Component {
    render() {
        return (
            <>
            <nav>
                <ul className='left-link'>
                    <li>
                        <a href="/HomePage">
                            home
                        </a>
                    </li>
                    <li>
                        <a href="#collection">
                            collection
                        </a>
                    </li>
                    <li>
                        <a href="#contact">
                            contact
                        </a>
                    </li>
                </ul>
            </nav>
            <span></span>
        </>
        );
    }
}

export default FooterLink;
